"use strict";(self.webpackChunk_genesislcap_docs=self.webpackChunk_genesislcap_docs||[]).push([[44156],{84489:function(e){e.exports=JSON.parse('{"label":"web components","permalink":"/tags/web-components","allTagsPath":"/tags","count":43,"items":[{"id":"version-2022.3/web/web-components/grids/data-grid","title":"Data grid","description":"A more light-weight grid for scenarios where you don\'t need the full power of Grid Pro.","permalink":"/web/web-components/grids/data-grid"},{"id":"version-2022.3/web/web-components/grids/grid-pro/grid-pro-genesis-cell","title":"Grid Pro - Cell","description":"This is a slotted component that allows a \\"visual approach\\" when configuring cell renderers. Each grid-pro-cell takes an ICellRendererFunc typed function.","permalink":"/web/web-components/grids/grid-pro/grid-pro-genesis-cell"},{"id":"version-2022.3/web/web-components/grids/grid-pro/grid-pro-genesis-column","title":"Grid Pro - Column","description":"This is a slotted component that allows a more \\"visual approach\\" when defining columns. Each grid-pro-column takes a ColDef typed object.","permalink":"/web/web-components/grids/grid-pro/grid-pro-genesis-column"},{"id":"version-2022.3/web/web-components/grids/grid-pro/grid-pro-connected","title":"Grid Pro - Connected data","description":"Set-up","permalink":"/web/web-components/grids/grid-pro/grid-pro-connected"},{"id":"version-2022.3/web/web-components/grids/grid-pro/grid-pro-genesis-datasource","title":"Grid Pro - Genesis datasource","description":"Used in Connected Data scenarios, this will fetch data from a Genesis server (or any other server that implements the Genesis protocol).   Available attributes and props may change in the future and are open for feedback but are reflecting the DATA_LOGON message options](/creating-applications/defining-your-application/integrations/rest-endpoints/#data_logon)","permalink":"/web/web-components/grids/grid-pro/grid-pro-genesis-datasource"},{"id":"version-2022.3/web/web-components/grids/grid-pro/grid-pro-intro","title":"Grid Pro - Introduction","description":"Use cases","permalink":"/web/web-components/grids/grid-pro/grid-pro-intro"},{"id":"version-2022.3/web/web-components/grids/grid-pro/grid-pro-renderers","title":"Grid Pro - Renderers","description":"When dealing with data, you usually have to render the data in a way that is meaningful to the user. This is the purpose of the grid-pro-renderers. The rendering can vary from one column to another, from boolean typed columns that need to be rendered as a checkbox to a column that needs to be rendered as a percentage.","permalink":"/web/web-components/grids/grid-pro/grid-pro-renderers"},{"id":"version-2022.3/web/web-components/grids/grid-pro/grid-pro-simple","title":"Grid Pro - Simple data","description":"The examples below use JSX syntax. Real-world scenarions might be different, depending on the client application tooling and structure.","permalink":"/web/web-components/grids/grid-pro/grid-pro-simple"},{"id":"version-2022.3/web/web-components/interaction/accordion","title":"Web Components - Accordion","description":"An accordion is a vertically stacked set of interactive headings representing a section of content. The headings function as controls that enable users to reveal or hide their associated sections of content. Accordions are commonly used to reduce the need to scroll when presenting multiple sections of content on a single page.","permalink":"/web/web-components/interaction/accordion"},{"id":"version-2022.3/web/web-components/interaction/anchor","title":"Web Components - Anchor","description":"An anchor is a piece of text that marks the beginning and/or the end of a hypertext link.","permalink":"/web/web-components/interaction/anchor"},{"id":"version-2022.3/web/web-components/interaction/anchored-region","title":"Web Components - Anchored region","description":"An anchored region is a container component that enables you to create layouts where the contents of the anchored region can be positioned relative to another \\"anchor\\" element. Additionally, the anchored region can react to the available space between the anchor and a parent \\"viewport\\" element such that the region is placed on the side of the anchor with the most available space, or even resize itself based on that space.","permalink":"/web/web-components/interaction/anchored-region"},{"id":"version-2022.3/web/web-components/presentation/avatar","title":"Web Components - Avatar","description":"The avatar component is used to graphically represent a user or an object.","permalink":"/web/web-components/presentation/avatar"},{"id":"version-2022.3/web/web-components/presentation/badge","title":"Web Components - Badge","description":"The badge component is used to highlight an item or flag its status.","permalink":"/web/web-components/presentation/badge"},{"id":"version-2022.3/web/web-components/presentation/breadcrumb","title":"Web Components - Breadcrumb","description":"As defined by the W3C:","permalink":"/web/web-components/presentation/breadcrumb"},{"id":"version-2022.3/web/web-components/form/button","title":"Web Components - Button","description":"Button component enables users to trigger actions, such as submitting a form or opening a dialog.","permalink":"/web/web-components/form/button"},{"id":"version-2022.3/web/web-components/presentation/card","title":"Web Components - Card","description":"The card component is a visual container without semantics, which takes children. Cards are snapshots of content that are typically used in a group to present collections of related information.","permalink":"/web/web-components/presentation/card"},{"id":"version-2022.3/web/web-components/form/checkbox","title":"Web Components - Checkbox","description":"An implementation of a checkbox as a form-connected Web Component.","permalink":"/web/web-components/form/checkbox"},{"id":"version-2022.3/web/web-components/form/combobox","title":"Web Components - Combobox","description":"A combobox is an input with an associated pop-up that enables users to select a value from a collection of possible values (auto-complete).","permalink":"/web/web-components/form/combobox"},{"id":"version-2022.3/web/web-components/interaction/dialog","title":"Web Components - Dialog","description":"A dialog component presents content to the user. Unlike modal it doesn\'t prevent the user from interacting with other content on the page.","permalink":"/web/web-components/interaction/dialog"},{"id":"version-2022.3/web/web-components/presentation/disclosure","title":"Web Components - Disclosure","description":"A disclosure component is the implementation of native details and summary controls, which toggles the visibility of the extra content. Visually, it would look like a button or hyperlink beneath extra content. As defined by the W3C:","permalink":"/web/web-components/presentation/disclosure"},{"id":"version-2022.3/web/web-components/presentation/divider","title":"Web Components - Divider","description":"A Web Component implementation of a horizontal rule.","permalink":"/web/web-components/presentation/divider"},{"id":"version-2022.3/web/web-components/interaction/flipper","title":"Web Components - Flipper","description":"The flipper component is most often used to page through blocks of content or collections of UI elements. As flippers are often a supplemental form of navigation, the flippers are hidden by default to avoid duplicate keyboard interaction. Passing an attribute of aria-hidden=\\"false\\" will expose the flippers to assistive technology.","permalink":"/web/web-components/interaction/flipper"},{"id":"version-2022.3/web/web-components/presentation/horizontal-scroll","title":"Web Components - Horizontal scroll","description":"An implementation of a content scroller as a Web Component.","permalink":"/web/web-components/presentation/horizontal-scroll"},{"id":"version-2022.3/web/web-components/interaction/listbox","title":"Web Components - Listbox","description":"An implementation of a listbox. While any DOM content is permissible as a child of the listbox, only alpha-option elements, option elements, and slotted items with role=\\"option\\" will be treated as options and receive keyboard support.","permalink":"/web/web-components/interaction/listbox"},{"id":"version-2022.3/web/web-components/interaction/menu","title":"Web Components - Menu","description":"As defined by the W3C:","permalink":"/web/web-components/interaction/menu"},{"id":"version-2022.3/web/web-components/interaction/modal","title":"Web Components - Modal","description":"A modal component will prevent the user from interacting with other content on the page. An alternative is the dialog component.","permalink":"/web/web-components/interaction/modal"},{"id":"version-2022.3/web/web-components/form/number-field","title":"Web Components - Number field","description":"A text field for numeric entry.","permalink":"/web/web-components/form/number-field"},{"id":"version-2022.3/web/web-components/form/option","title":"Web Components - Option","description":"An implementation of an option.","permalink":"/web/web-components/form/option"},{"id":"version-2022.3/web/web-components/form/picker","title":"Web Components - Picker","description":"A selection input with support for selection of multiple options.","permalink":"/web/web-components/form/picker"},{"id":"version-2022.3/web/web-components/presentation/progress","title":"Web Components - Progress","description":"The Progress and Progress Ring components are used to display","permalink":"/web/web-components/presentation/progress"},{"id":"version-2022.3/web/web-components/presentation/progress-ring","title":"Web Components - Progress ring","description":"The Progress and Progress Ring components are used to display one of the following:","permalink":"/web/web-components/presentation/progress-ring"},{"id":"version-2022.3/web/web-components/form/radio","title":"Web Components - Radio","description":"A selection input with support for selection of multiple options.","permalink":"/web/web-components/form/radio"},{"id":"version-2022.3/web/web-components/form/radio-group","title":"Web Components - Radio group","description":"As defined by the W3C:","permalink":"/web/web-components/form/radio-group"},{"id":"version-2022.3/web/web-components/form/select","title":"Web Components - Select","description":"An implementation of an HTML select element as a form-connected Web Component.","permalink":"/web/web-components/form/select"},{"id":"version-2022.3/web/web-components/presentation/skeleton","title":"Web Components - Skeleton","description":"The skeleton component is used as a visual placeholder for an element while it is in a loading state. It usually presents itself as a simplified wireframe-like version of the UI it is representing.","permalink":"/web/web-components/presentation/skeleton"},{"id":"version-2022.3/web/web-components/form/slider","title":"Web Components - Slider","description":"An implementation of a range slider as a form-connected Web Component.","permalink":"/web/web-components/form/slider"},{"id":"version-2022.3/web/web-components/form/switch","title":"Web Components - Switch","description":"An implementation of a switch as a form-connected Web Component.","permalink":"/web/web-components/form/switch"},{"id":"version-2022.3/web/web-components/interaction/tab","title":"Web Components - Tab","description":"Tabs are a set of layered sections of content that display one panel of content at a time. Each tab panel has an associated tab element that, when activated, displays the panel. The list of tab elements is arranged along one edge of the currently displayed panel.","permalink":"/web/web-components/interaction/tab"},{"id":"version-2022.3/web/web-components/form/text-area","title":"Web Components - Text area","description":"An implementation of an HTML textarea element as a form-connected Web Component. The alpha-text-area supports two visual appearances: outline and filled, with the control defaulting to the outline appearance.","permalink":"/web/web-components/form/text-area"},{"id":"version-2022.3/web/web-components/form/text-field","title":"Web Components - Text field","description":"An implementation of a text field as a form-connected Web Component. The alpha-text-field supports two visual appearances: outline and filled, with the control defaulting to the outline appearance.","permalink":"/web/web-components/form/text-field"},{"id":"version-2022.3/web/web-components/form/toolbar","title":"Web Components - Toolbar","description":"As defined by the W3C:","permalink":"/web/web-components/form/toolbar"},{"id":"version-2022.3/web/web-components/interaction/tooltip","title":"Web Components - Tooltip","description":"The alpha-tooltip component is used to provide extra information about another element when the user hovers over it.","permalink":"/web/web-components/interaction/tooltip"},{"id":"version-2022.3/web/web-components/interaction/tree-view","title":"Web Components - Tree view","description":"As defined by the W3C:","permalink":"/web/web-components/interaction/tree-view"}]}')}}]);